// Import Libraries
import React, { useState } from "react";

const PreviousSearches = (props) => {
  const [view, setView] = useState(false);

  const onClickHandler = () => {
    setView(!view);
  };

  return (
    <div class=" bg-gradient-to-r from-custom-light-blue to-custom-blue w-3/4 h-14 p-3 flex flex-row border-white border-2 bg-transparent rounded-3xl justify-items-start items-center text-white ">
      <text class="flex-1">1. John</text>
      <text class="flex-1">Confidence: 13.88</text>
      <text class="flex-0.8 text-right mr-2">13 min Ago</text>
      <button onClick={onClickHandler}>
        {view ? (
          <i class="far fa-eye-slash text-white"></i>
        ) : (
          <i class="far fa-eye text-white"></i>
        )}
      </button>
    </div>
  );
};

export default PreviousSearches;
